'%{
\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWe are psychologically programmed not only to nurture what we love but to love what we nurture.\n\nJune 13, 2017\n\u001c33\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cI have often observed this distinctive confusion: these days, whether you are online or not, it is easy for people to end up unsure if they are closer together or further apart. I\n\nDecember 25, 2014\n\u001c38\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWinston Churchill said, “We shape our buildings and then they shape us.” 23 We make our technologies, and they, in turn, shape us. So, of every technology we must ask, Does it serve our human purposes?\n\nDecember 26, 2014\n\u001c46\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cTechnologies, in every generation, present opportunities to reflect on our values and direction\n\nDecember 26, 2014\n\u001c46\n\u0011\n\u0011\n\n\nCOACHING AS CURE\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cHe doesn’t like the wording on a questionnaire that Kidd had given him to fill out. Gordon protests about questions such as “Was the system sincere in trying to help me?” and “Was the system interested in interacting with me?” He thinks that the words “sincere” and “interested” should be off limits because they imply that the robot is more than a machine. Gordon says, “Talking about a robot in this way does not make any sense.... There are terms like ‘relationship,’ ‘trust,’ and a couple of others....\n\nApril 15, 2015\n\u001c179\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cKidd maintains that there are no experimental lessons or hypotheses to be gleaned from these stories, but I find support for a consistent narrative. A sociable robot is sent in to do a job—it could be doing crosswords or regulating food intake—and once it’s there, people attach. Things happen that elude measurement. You begin with an idea about curing difficulties with dieting. But then the robot and person go to a place where the robot is imagined as\n\nApril 15, 2015\n\u001c180\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001ca cure of souls. The stories of Andy, Jonathan, Rose, and Gordon illustrate different styles of relating to sociable robots and suggest distinct stages in relationships with them. People reassure themselves that the environment is safe; the robot does not make them seem childish. They are won over by the robot’s responsive yet stable presence. It seems to care about them, and they learn to be comforted. It is common for people to talk to cars and stereos, household appliances, and kitchen ovens. I have studied these kinds of conversations for more than three decades and find that they differ from conversations with sociable robots in important ways. When people talk to their ovens and Cuisinarts, they project their feelings in rants and supplications. When talking to sociable robots, adults, like children, move beyond the psychology of projection to that of engagement: from Rorschach to relationship.\n\nApril 15, 2015\n\u001c180\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe robots’ special\n\nApril 15, 2015\n\u001c181\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001caffordance is that they simulate listening, which meets a human vulnerability: people want to be heard. From there it seems a small step to finding ourselves in a place where people take their robots into private spaces to confide in them. In this solitude, people experience new intimacies. The gap between experience and reality widens. People feel heard, but the robots cannot hear.\n\nApril 15, 2015\n\u001c181\n\u0011\n\u0011\n\n\nCHAPTER 10 - No need to call\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cMay 22, 2015\n\u001c278\n\u0011\n\u0011\n\n\nAUDREY: A LIFE ON THE SCREEN\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cMay 22, 2015\n\u001c279\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cMay 22, 2015\n\u001c280\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWhen you instant-message you can cross things out, edit what you say, block a person, or sign off. A phone conversation is a lot of pressure. You’re always expected to uphold it, to keep it going, and that’s too much pressure.... You have to just keep going . . . “Oh, how was your day?” You’re trying to think of something else to say real fast so the conversation doesn’t die out.\n\nMay 22, 2015\n\u001c280\n\u0011\n\u0011"},{"ty":"ae","et":"inline","id":"i.0","epm":{"ee_eo":{"eo_bo":{"ln_c":"#000000","ln_s":0,"ln_w":0.0},"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"lc_sci":""},"i_wth":105.0,"eo_rd":null,"eo_mb":1.5,"eo_at":null,"eo_hb":false,"eo_lc":null,"eo_rtd":"","i_crop":{"crop_oxr":0.0,"crop_oyr":0.0,"crop_rot":0.0,"crop_hr":1.0,"crop_wr":1.0},"i_ht":150.9375,"i_rot":0.0,"i_clst":{"cv":{"op":"set","opValue":[]}},"eo_ml":1.5,"i_bri":0.0,"eo_mr":1.5,"i_src":null,"eo_ad":"Cover Image","i_cid":"1G1FWWftWJCsFN3oqWiSkC-MQOJ3oXd3LO4pjxhY","i_cont":0.0,"i_opa":1.0,"eo_mt":1.5,"eo_type":0}}},{"ty":"ae","et":"inline","id":"i.1","epm":{"ee_eo":{"eo_bo":{"ln_c":"#000000","ln_s":0,"ln_w":0.0},"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"lc_sci":""},"i_wth":24.0,"eo_rd":null,"eo_mb":1.5,"eo_at":null,"eo_hb":false,"eo_lc":null,"eo_rtd":"","i_crop":{"crop_oxr":0.0,"crop_oyr":0.0,"crop_rot":0.0,"crop_hr":1.0,"crop_wr":1.0},"i_ht":18.0,"i_rot":0.0,"i_clst":{"cv":{"op":"set","opValue":[]}},"eo_ml":1.5,"i_bri":0.0,"eo_mr":1.5,"i_src":null,"eo_ad":null,"i_cid":"1IB9ntNRmqPifhEDHnZouuNvMZNprfRLii-fuOfU","i_cont":0.0,"i_opa":1.0,"eo_mt":1.5,"eo_type":0}}},{"ty":"ae","et":"inline","id":"i.10","epm":{"ee_eo":{"eo_bo":{"ln_c":"#000000","ln_s":0,"ln_w":0.0},"eo_lco":{"lc_oi":"","lc_cs":"","lc_ct":0,"lc_sci":""},"i_wth":24.0,"eo_rd":null,"eo_mb":1.5,"eo_at":null,"eo_hb":false,"eo_lc":null,"eo_rtd":"","i_crop":{"crop_oxr":0.0,"crop_oyr":0.0,"crop_rot":0.0,"crop_hr":1.0