:13.0,"ts_ff":"Droid Serif","ts_it_i":false,"ts_bgc":"#ffb8a1","ts_fs_i":false,"ts_bgc_i":false}},{"ty":"as","st":"text","si":4046,"ei":4059,"sm":{"ts_ff_i":false,"ts_fgc":"#757575","ts_fgc_i":false,"ts_va":"nor","ts_va_i":false,"ts_fs":11.0,"ts_ff":"Roboto","ts_fs_i":false}},{"ty":"as","st":"text","si":4060,"ei":4066,"sm":{"ts_un":true,"ts_fgc":"#1565c0","ts_un_i":false,"ts_fgc_i":false,"ts_va":"nor","ts_va_i":false}}]; DOCS_modelChunkLoadStart = new Date().getTime(); _getTimingInstance().incrementTime(, DOCS_modelChunkLoadStart - DOCS_modelChunkParseStart); DOCS_warmStartDocumentLoader.loadModelChunk(DOCS_modelChunk); DOCS_modelChunk = undefined;</script><script type="text/javascript" nonce="T0h47O42xkvb/sejFNK8+kF9dK4"  nonce="T0h47O42xkvb/sejFNK8+kF9dK4">DOCS_modelChunkParseStart = new Date().getTime();</script><script type="text/javascript" nonce="T0h47O42xkvb/sejFNK8+kF9dK4"  nonce="T0h47O42xkvb/sejFNK8+kF9dK4">DOCS_modelChunk = [{"ty":"is","ibi":4067,"s":"\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThis last is what Audrey likes least—the end of conversations. A phone call, she explains, requires the skill to end a conversation “when you have no real reason to leave.... It’s not like there is a reason. You just want to. I don’t know how to do that. I don’t want to learn .”\n\nMay 22, 2015\n\u001c281\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cEnding a call is hard for Audrey because she experiences separation as rejection; she projects onto others the pang of abandonment she feels when someone ends a conversation with her. Feeling unthreatened when someone wants to end a conversation may seem a small thing, but it is not. It calls upon a sense of self-worth; one needs to be at a place where Audrey has not arrived. It is easier to avoid the phone; its beginnings and endings are too rough on her. Audrey is not alone in this. Among her friends, phone calls are infrequent, and she says, “Face-to-face conversations happen way less than they did before. It’s always, ‘Oh, talk to you online.’” This means, she explains, that things happen online that “should happen in person . . . Friendships get broken. I’ve had someone ask me out in a text message. I’ve had someone break up with me online.” But Audrey is resigned to such costs\n\nI want to use video as a bounds to slip in and out.\n\nMay 22, 2015\n\u001c281\n\u0011\n\u0011\n\n\nFINER DISTINCTIONS\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cMay 23, 2015\n\u001c297\n\u0011\n\u0011\n\n\nCONCLUSION\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWe enjoy continual connection but rarely have each other’s full attention.\n\nMay 25, 2015\n\u001c407\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWe have many new encounters but may come to experience them as tentative, to be put “on hold” if better ones come along. Indeed, new encounters need not be better to get our attention. We are wired to respond positively to their simply being new. We can work from home, but our work\n\nMay 25, 2015\n\u001c408\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cbleeds into our private lives until we can barely discern the boundaries between them. We like being able to reach each other almost instantaneously but have to hide our phones to force ourselves to take a quiet moment.\n\nMay 25, 2015\n\u001c408\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cWe brag about how many we have “friended” on Facebook, yet Americans say they have fewer friends than before. 2 When asked in whom they can confide and to whom they turn in an emergency, more and more say that\n\nMay 25, 2015\n\u001c408\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001ctheir only resource is their family.\n\nMay 25, 2015\n\u001c408\n\u0011\n\u0011\n\n\u0010\u0012\u001c\n\u0010\u0012\u001c*\n\u001cThe ties we form through the Internet are not, in the end, the ties that bind. But they are the ties that preoccupy. We text each other at family dinners, while we jog, while we drive, as we push our children on swings in the park. We don’t want to intrude on each other, so instead we constantly intrude on each other, but not in “real time.”\n\nMay 25, 2015\n\u001c408\n\u0011\n\u0011"}
